INSERT INTO awa (`id`,`ques`) VALUES (1,'There is little justification for society to make extraordinary efforts – especially at a great cost in money and jobs – to save endangered animal or plant species.');
INSERT INTO awa (`id`,`ques`) VALUES (2,'The best test of an argument is the argument’s ability to convince someone with an opposing viewpoint.');
INSERT INTO awa (`id`,`ques`) VALUES (3,'Any leader who is quickly and easily influenced by shifts in popular opinion will accomplish little.');
INSERT INTO awa (`id`,`ques`) VALUES (4,'Educators should base their assessment of students’ learning not on students’ grasp of facts but on the ability to explain the ideas, trends, and concepts that those facts illustrate.');
INSERT INTO awa (`id`,`ques`) VALUES (5,'Critical judgment of work in any given field has little value unless it comes from someone who is an expert in that field.');
INSERT INTO awa (`id`,`ques`) VALUES (6,'Nations should pass laws to preserve any remaining wilderness areas in their natural state.');
INSERT INTO awa (`id`,`ques`) VALUES (7,'Some people claim that you can tell whether a nation is great by looking at the achievements of its rulers, artists, or scientists. Others argue that the surest indicator of a great nation is, in fact, the general welfare of all its people.');
INSERT INTO awa (`id`,`ques`) VALUES (8,'The following appeared in a recommendation from the president of Amburg’s Chamber of Commerce. Last October the city of Belleville installed high-intensity lighting in its central business district');
INSERT INTO awa (`id`,`ques`) VALUES (9,'An ancient, traditional remedy for insomnia – the scent of lavender flowers – has now been proved effective. In a recent study, 30 volunteers with chronic insomnia slept each night for three weeks on lavender-scented pillows in a controlled room where their sleep was monitored electronically. During the first week, volunteers continued to take their usual sleeping medication. They slept soundly but wakened feeling tired. At the beginning of the second week, the volunteers discontinued their sleeping medication. During that week, they slept less soundly than the previous week and felt even more tired. During the third week, the volunteers slept longer and more soundly than in the previous two weeks. Therefore, the study proves that lavender cures insomnia within a short period of time.');
